import './ExpenseForm.css';
const ExpenseForm = () => {
    const titleChangeHandeler = () => {
      console.log('changed');
    };
    return (
    <form>
        <div className='new-expense__controls'>
            <label>
                New Form
            </label>
            <input type='text' onChange={titleChangeHandeler}/>
        </div>
    </form>
    );
}
export default ExpenseForm;
